import React, { useState, useEffect } from 'react';
import Container from '@material-ui/core/Container';
import CssBaseline from '@material-ui/core/CssBaseline';
import Table from '../../components/Table';
import { getGenres } from '../../services/Genres/genreService';
import useStyles from './styles';

export default function Genres() {
  const classes = useStyles();
  const [selected, setSelected] = useState([]);
  const [rows, setRows] = useState([]);

  function createFakeData(id, name, creationDate, status) {
    return { id, name, creationDate, status };
  }

  const fakeRows = [
    createFakeData(1, 'Ação', '22/03/2020', 'Ativo'),
    createFakeData(1, 'Romance', '22/03/2020', 'Ativo'),
    createFakeData(1, 'Ficção Científica', '22/03/2020', 'Ativo'),
    createFakeData(1, 'Terror', '22/03/2020', 'Ativo'),
    createFakeData(1, 'Aventura', '22/03/2020', 'Ativo'),
    createFakeData(1, 'Drama', '22/03/2020', 'Ativo'),
    createFakeData(1, 'Comédia', '22/03/2020', 'Ativo'),
    createFakeData(1, 'Animação', '22/03/2020', 'Ativo'),
    createFakeData(1, 'Policial', '22/03/2020', 'Ativo'),
  ];

  const headCells = [
    {
      id: 'name',
      numeric: false,
      disablePadding: true,
      label: 'Nome',
    },
    {
      id: 'creationDate',
      numeric: false,
      disablePadding: true,
      label: 'Data Criação',
    },
    { id: 'status', numeric: false, disablePadding: true, label: 'Status' },
  ];

  // useEffect(() => {
  //   async function loadGenres() {
  //     const genres = await getGenres();
  //     setRows(genres);
  //   }

  //   loadGenres();
  // });

  return (
    <Container component="main">
      <CssBaseline />
      <div className={classes.paper}>
        <Table
          title="Gêneros"
          headCells={headCells}
          rows={fakeRows}
          selected={selected}
          setSelected={setSelected}
          defaultSortedProperty="name"
        />
      </div>
    </Container>
  );
}
